// src/App.tsx

import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import MenuBar from './MenuBar';
import MainPage from './MainPage';
import SignInPage from './SignInPage';
import SignUpPage from './SignUpPage';
import HorseDetailsPage from './HorseDetailsPage';

function App() {

  const handleSignIn = (username: string, password: string) => {
    console.log(`Signed in with username: ${username} and password: ${password}`);
    // You can add more logic here such as authentication, redirect, etc.
  };
  return (
    <Router>
      <div className="App">
        <MenuBar />
        <div style={{ marginRight: '200px', padding: '20px' }}>
          <Routes>
            <Route path="/" element={<MainPage />} />
            <Route path="/sign-in" element={<SignInPage onSignIn={handleSignIn} />} />
            <Route path="/sign-up" element={<SignUpPage />} />
            <Route path="/horse-details" element={<HorseDetailsPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
